import React from "react";
import MaaS360Data from "../components/MaaS360Data";

function MainPage() {
  const device_id = 1;

  return (
    <div>
      <h1>Main Page</h1>
      <h2>Device Data</h2>
      <MaaS360Data device_id={device_id} />
    </div>
  );
}

export default MainPage;
